window.bookSummaryJSON = "<p><b>Cutter and his trio are back in action and looking to add to their group! </b></p> <p>Atticus and the Rising are hell-bent on destroying every last Ender still breathing. In short, it's genocide.&nbsp;</p> <p>With Gehn's vision weighing heavily on his mind, Cutter and the women set out for Paris, determined to find their army and start a real revolution, one with more than a chance in hell of success. All the odds are stacked against them. Do you think Cutter cares?&nbsp;</p> <p>Hell no.&nbsp;</p> <p>Twists abound in this action-packed EndWorld sequel. Continue the titillating adventure today!&nbsp;</p> <p><b>Warning: </b>Contains a harem and mature content.</p>"; 
